import React, { useEffect, useState } from 'react'
import axios from 'axios'

//---------components-------
import Card from '../card/Card'
import Navbar from '../navbar/Navbar'


const Home = () => {

    const [user,setUser] =useState([])

    const fetchUser = ()=>{
        axios.get('https://randomuser.me/api/?page=3&results=1&seed=abc')
        .then((response)=>{
               console.log('random user checkingg ',response.data.results)
               setUser(response.data.results)
        })
        .catch((er)=>{
            console.log(er.message)
        })
    }
  
    useEffect(()=>{
       
        fetchUser()
        
    },[])
  return (
    <div className='mb-3'>
        <Navbar/>
        <Card users = {user}/>

    </div>
  )
}

export default Home
